// import logo from "./logo.svg";
import React from "react";
import "./App.css";

class App extends React.Component {
  constructor(props) {
    super();
    this.state = {
      id: 1,
      title: "buttermilk pancakes",
      category: "breakfast",
      price: 15.99,
      img: "./images/item-1.jpeg",
      desc: `I'm baby woke mlkshk wolf bitters live-edge blue bottle, hammock freegan copper mug whatever cold-pressed `,
    };
  }
  render() {
    const { title, category, price, img, desc } = this.state;
    //Card component
    return (
      <div>
        <div>{title}</div>
        <div>{price}</div>
        <div>{category}</div>
        <div>{desc}</div>
        <div>{img}</div>
      </div>
    );
  }
}
export default App;
